  DEANS, Katherine Russell
  b 29.08.1958
  Katherine b. at Darfield. Address: 75 McBride Street, Frankton, Central Otago.
  Katherine was educated at Selwyn House, Christchurch, and Craighead, Timaru. In 1979 she gained a
  Diploma in Horticulture and in 1984, a Diploma in Landscape Technology, both from Lincoln
  University. During 1979-82 she completed Stages 1 and 2 of the New Zealand Ski Instructor's
  course, as well as the Coaches course. In 1990 she completed the Avalanche Course 1 and in 1995, a
  Mountain Skills course.
  From 1979, Katherine worked as a ski instructor in Australia, New Zealand and America. In 1984-86
  she worked as a designer for Canterbury Landscapes and in 1987 she moved to Queenstown and worked
  for Boffa Miskell until 1994, Since then she has been a self-employed landscape designer in
  Queenstown and a part-time heli-guide in the winter. She has been involved with large landscape
  projects, two of which won National Architectural Awards - Millbrook Resort and THC Gardens in
  Queenstown. She was also involved in restoring the gardens of Riccarton House where the Deans
  first settled in Christchurch.
  Katherine has a passion for skiing and won the New Zealand Powder Eight Ski Competition in 1992 and
  1992. She represented New Zealand in this competition in Canada and was placed twelfth in 1990 and
  4th in the Women's World Powder Eight in 1993. She has skiied in Australia, New Zealand, Canada,
  Europe, America, India and Alaska. Her other interests are tramping, climbing, mountain biking,
  tennis, running and dancing.
